import React from "react";
import styled from "styled-components";

const Main = () => {
  return (
    <React.Fragment>
      <DIV>
        <P>
          <span>당신 근처의</span>
          <br />
          <span>당근마켓</span>
        </P>
        <span>중고 거래부터 동네 정보까지, 이웃과 함께 해요</span>
        <br></br>
        <span>가깝고 따뜻한 당신의 근처를 만들어요.</span>
      </DIV>
    </React.Fragment>
  );
};

export default Main;

const DIV = styled.div`
  width: 1024px;
  height: 760px;
  /* margin: 0 auto; */
  position: relative;
  background-color: #fbf7f2;
`;

const P = styled.div`
  font-size: 4.8rem;
  line-height: 1.3;
  padding-top: 22rem;
  margin-bottom: 3.2rem;
  letter-spacing: -0.4px;
`;
